import { useState } from "react";
import { Typeahead } from "react-bootstrap-typeahead";
import { ReactElement } from "react-markdown/lib/react-markdown";
import { actorPeliculasDTO } from "./actores.model";

export default function TypeAheadActores(props: typeAheadActoresProps) {
  const actores: actorPeliculasDTO[] = [
    {
      id: 1,
      nombre: "Tom Holland",
      personaje: "Spider-Man",
      foto: "data:image/jpeg;base64,",
    },
    {
      id: 2,
      nombre: "Samuel L. Jackson",
      personaje: "",
      foto: "data:image/jpeg;base64,",
    },
    {
      id: 3,
      nombre: "Keanu Reeves",
      personaje: "Neo",
      foto: "data:image/jpeg;base64,",
    },
  ];

  const seleccion: actorPeliculasDTO[] = [];

  const [elementoArrastrado, setElementoArrastrado] = useState<actorPeliculasDTO | undefined>(undefined);

  function manejarDragStart(actor:actorPeliculasDTO){
    setElementoArrastrado(actor);
  }

  function manejarDragOver(actor: actorPeliculasDTO){
    if (!elementoArrastrado){
      return;
    }

    if(actor.id !== elementoArrastrado.id){
      const elementoArrastradoIndice = props.actores.findIndex(x => x.id === elementoArrastrado.id)
      const actorIndice = props.actores.findIndex(x => x.id === actor.id);

      const actores = [...props.actores];
      actores[actorIndice] = elementoArrastrado;
      actores[elementoArrastradoIndice] = actor;

      props.onAdd(actores);
    }
  }

  return (
    <>
      <label>Actores</label>
      <Typeahead
        id="typeahead"
        onChange={(actores) => {
          if (props.actores.findIndex((x) => x.id === actores[0].id) === -1) {
            props.onAdd([...props.actores, actores[0]]);
          }
        }}
        options={actores}
        labelKey={(actor) => actor.nombre}
        filterBy={["nombre"]}
        placeholder="Escriba el nombre del actor..."
        minLength={2}
        flip={true}
        selected={seleccion}
        renderMenuItemChildren={(actor) => (
          <>
            <img
              alt="imagen actor"
              src={actor.foto}
              style={{ height: "64px", marginRight: "10px", width: "64px" }}
            />
            <span>{actor.nombre}</span>
          </>
        )}
      />

      <ul className="list-group">
        {props.actores.map((actor) => (
          <li 
          draggable={true}
          onDragStart={() => manejarDragStart(actor)}
          onDragOver={() => manejarDragOver(actor)}
          className="list-group-item list-group-item-action" key={actor.id}>
            {props.listadoUI(actor)}
            <span
              className="badge badge-primary badge-pill pointer"
              style={{ marginLeft: "0.5rem" }}
              onClick={() => props.onRemove(actor)}
            >
              X
            </span>
          </li>
        ))}
      </ul>
    </>
  );
}

interface typeAheadActoresProps {
  actores: actorPeliculasDTO[];
  onAdd(actores: actorPeliculasDTO[]): void;
  listadoUI(actor: actorPeliculasDTO): ReactElement;
  onRemove(actor: actorPeliculasDTO): void;
}
